import './ExpenseItem.css';

const ExpenseItem = () => {
    return(
        <div>
            <div>
                <span>Date</span>
            </div>
             <div>
                <h2>Title</h2>
                <div>
                <span>Amount</span></div>
            </div>
        </div>
    )
}

export default ExpenseItem;
